"""- Variância (amostral):
<br><img src="data:image/png;base64," alt="Descrição da imagem" width="300"/>
"""

print("Variância:", round(variancia(dados['Tempo de Permanência']), 2))

"""- Desvio Padrão (amostral):
<br><img src="data:image/png;base64," alt="Descrição da imagem" width="300"/>

"""

print("Desvio padrão:", round(desvio_padrao(dados['Tempo de Permanência']), 2))

